export default function Footer({ src, alt, title, weekday, time }) {
    return (
        <footer>
            <div className="poster" alt="poster">
                <img src={src} alt={alt} />
            </div>
            <div className="sessionInfor"></div>
                            <span className="choosenMovieName">
                            {title}
                        </span>
                        {weekday !== undefined &&
                            <span className="choosenMovieTime">
                                {weekday} - {time}
                            </span>
                        }
        </footer>
    );

}
